import React, { useState } from 'react';

function GuildCompetition({ guilds, fetchGuilds }) {
  const [selectedGuild, setSelectedGuild] = useState(null);
  const [opponentGuild, setOpponentGuild] = useState(null);
  const [stake, setStake] = useState(0);

  const initiateCompetition = async () => {
    try {
      const response = await fetch('http://localhost:8080/api/initiateCompetition', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
        body: JSON.stringify({ guildId: selectedGuild, opponentGuildId: opponentGuild, stake }),
      });

      const result = await response.json();
      if (!response.ok) throw new Error(result.error || 'Failed to initiate competition');

      alert('Competition initiated');
      fetchGuilds();
    } catch (error) {
      console.error('Error initiating competition:', error.message);
    }
  };

  const resolveCompetition = async () => {
    try {
      const response = await fetch('http://localhost:8080/api/resolveCompetition', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
        body: JSON.stringify({ guildId: selectedGuild, opponentGuildId: opponentGuild }),
      });

      const result = await response.json();
      if (!response.ok) throw new Error(result.error || 'Failed to resolve competition');

      alert(`Competition resolved. Winner: ${result.winner.name}`);
      fetchGuilds();
    } catch (error) {
      console.error('Error resolving competition:', error.message);
    }
  };

  return (
    <div className="absolute w-full bg-black1 h-screen text-maincolor4">
      <div className="w-[55vw] bg-gradient-to-r from-black to-maincolor1 h-[15vh] m-[1.5vh] rounded-3xl p-[1vh] border-2 border-maincolor2">
        <div className="w-full h-full bg-gradient-to-r from-maincolor1 to-black border border-maincolor1 rounded-3xl border-1 flex items-center justify-between px-4">
          <div className="ml-[1vh] mr-[3vh] w-[10vh] h-[10vh] rounded-full">
            <img src={`images/guild.png`} className="rounded-full" alt="Guild" />
          </div>
          <div className="bg-gradient-to-r from-black to-maincolor5 w-4/5 h-2/5 rounded border-maincolor4 border-4 relative">
            <div className={`h-full bg-maincolor1 absolute right-0 border-maincolor4`} style={{ width: '50%' }}></div>
          </div>
          <div className="text-white ml-auto text-[1.5vw] w-[6vh] ml-[3vh]">00:00</div>
        </div>
      </div>
      <div className="w-[22vw] h-[50vh] bg-maincolor1 absolute right-0 top-0 m-[1vw] rounded-3xl p-[1vw]">
        <div className="w-full h-full flex grid grid-cols-2 grid-rows-3 gap-[1vw]">
          {guilds.map((guild, index) => (
            <div className="grid place-items-center" key={index}>
              <div className="relative h-[14vh] aspect-square bg-maincolor1 rounded-2xl outline outline-4 outline-maincolor4">
                <div onClick={() => setSelectedGuild(guild._id)}>
                  <img src={`images/guild.png`} className={`rounded-2xl ${selectedGuild === guild._id ? "border-8 border-maincolor5" : ""}`} alt="Guild" />
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <div className="w-[22vw] h-[45vh] bg-maincolor1 absolute right-0 bottom-0 m-[1vw] rounded-3xl">
        <div className="h-[5vh] m-[1.5vh] rounded-lg border-4 border-black flex items-center justify-center bg-gradient-to-r from-maincolor5 via-black to-maincolor2 relative">
          <span className="z-10">Stake: {stake}</span>
          <div className="h-full bg-maincolor1 rounded-sm absolute top-0 right-0 z-0" style={{ width: '100%' }}></div>
        </div>
        <div>
          <div className="h-[9vh] m-[1.5vh] p-2 rounded-3xl bg-gradient-to-r from-black to-maincolor5">
            <div className="w-full h-full bg-maincolor1 rounded-2xl p-[0.5vw] relative">
              <div className="absolute right-0 bottom-1">
                <img src="images/money.png" className="w-[2vw]" alt="Money" />
                {stake}
              </div>
              <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-xl font-extrabold">
                <p>Stake Amount</p>
              </div>
            </div>
          </div>
          <div className="w-full h-[4vh] flex justify-center items-center">
            <button onClick={initiateCompetition} className="w-[6vw] h-[4vh] bg-gradient-to-r from-maincolor2 to-maincolor5 text-black text-2xl font-extrabold rounded-3xl border-2 border-maincolor4 hover:text-maincolor4">
              Initiate
            </button>
            <button onClick={resolveCompetition} className="w-[6vw] h-[4vh] bg-gradient-to-r from-maincolor2 to-maincolor5 text-black text-2xl font-extrabold rounded-3xl border-2 border-maincolor4 hover:text-maincolor4">
              Resolve
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default GuildCompetition;
